import React, { useState } from 'react';
import Cookies from 'universal-cookie';


const Profile = () => {
    const cookies = new Cookies();
    const cookieData = cookies.get('users')// Pacman

    
    const deleteCookie = () => {
        cookies.remove('users', {path: '/'});
    }
    return(
        <>
            <div className='container d-flex justify-content-center'>
                {!cookieData ? (
                    <div className="card text-center">
                        <div className="card-header">
                            Informacija
                        </div>
                        <div className='card-body'>
                            <p>Šiuo metu neturite įsigyjęs loterijos bilieto</p>
                        </div>
                    </div>
                ):(
                    cookieData.map((item) => (
                        <div className="card text-center">
                            <div className="card-header">
                                Loterijos bilietas #{item.ticketNumber}
                            </div>
                            <div className='card-body'>
                                <p>{item.name}</p>
                                <p>{item.lastname}</p>
                            </div>
                        </div>
                    ))
                )}
            </div>
            {/* {cookieData?.map((item) => (
                <div className='mb-5'>
                    <p>{item.name}</p>
                    <p>{item.lastname}</p>
                    <p>{item.ticketNumber}</p>
                </div>

            ))}
        <button onClick={deleteCookie} className='btn btn-primary'>Remove cookie</button> */}
        </>
    )
}

export default Profile;
